import React from "react";

function Main(){
    return(
        <div id ='main'>
            <form id="user-form">
                <input id='userid'>Username</input>
                <input id="pass">Password</input>
                <input type="submit" id='button' >Login</input>
            </form>
        </div>
    )
}

export default Main;
